PREFIX fb: <http://rdf.freebase.com/ns/>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
SELECT ?actor ( SAMPLE( ?enLabel ) AS ?actorLabel ) WHERE {
  fb:m.0f1bg fb:film.film_character.portrayed_in_films ?performance .
  ?performance fb:film.performance.actor ?actor .
  OPTIONAL {
    ?actor rdfs:label ?enLabel .
    FILTER ( LANG( ?enLabel ) = "en" )
  }
}
GROUP BY ?actor

