PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
SELECT ?religionLabel ( GROUP_CONCAT( DISTINCT ?professionLabel ; separator = ", " ) AS ?professionsList ) ( GROUP_CONCAT( DISTINCT ?workLabel ; separator = ", " ) AS ?worksList ) ( GROUP_CONCAT( DISTINCT ?influencedLabel ; separator = ", " ) AS ?influencedList ) ( GROUP_CONCAT( DISTINCT ?influencedByLabel ; separator = ", " ) AS ?influencedByList ) WHERE {
  OPTIONAL {
    fb:m.0w6w fb:people.person.profession ?profession .
    ?profession rdfs:label ?professionLabel
    FILTER ( lang( ?professionLabel ) = 'en' )
  }
  OPTIONAL {
    fb:m.0w6w fb:book.author.works_written ?work .
    ?work rdfs:label ?workLabel
    FILTER ( lang( ?workLabel ) = 'en' )
  }
  OPTIONAL {
