    ?influencedBy rdfs:label ?influencedByLabel
    FILTER ( lang( ?influencedByLabel ) = 'en' )
  }
  OPTIONAL {
    fb:m.0w6w fb:people.person.religion ?religion .
    ?religion rdfs:label ?religionLabel
    FILTER ( lang( ?religionLabel ) = 'en' )
  }
}
GROUP BY ?religionLabel

