SELECT ?officeholder ?officeholderLabel WHERE {
  fb:m.02xry fb:government.governmental_jurisdiction.governing_officials ?pos .
  ?pos fb:government.government_position_held.office_position_or_title fb:m.01h_0k .
  ?pos fb:government.government_position_held.office_holder ?officeholder .
