PREFIX fb: <http://rdf.freebase.com/ns/>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
SELECT DISTINCT ?language ?language_label ?type WHERE {
  {
    fb:m.0jgd fb:location.country.languages_spoken ?language .
    OPTIONAL {
      ?language rdfs:label ?language_label .
      FILTER ( lang( ?language_label ) = 'en' )
    }
    BIND( "spoken" AS ?type )
  } UNION {
    fb:m.0jgd fb:location.country.official_language ?language .
    OPTIONAL {
      ?language rdfs:label ?language_label .
      FILTER ( lang( ?language_label ) = 'en' )
    }
    BIND( "official" AS ?type )
  }
}

